INSERT INTO `Xpage` VALUES (96,1,'<p><!** Image 1 align=\"right\" alt=\"Home Cooking\" sub=\"Home Cooking\"   ></p>\n<p>We\'re always happy to hear from you. You can contact us via email at <a href=\"mailto:contact@sourcefabric.org\">contact@sourcefabric.org</a></p>\n<p><strong>Postal Address:</strong></p>\n<p>Sourcefabric o.p.s.<br />Salv&aacute;torsk&aacute; 10<br />110 00 Praha 1<br />Czech Republic</p>\n<p>phone: +420 222 362 540</p>\n<p><strong>Toronto office:</strong></p>\n<p>Sourcefabric<br />Centre for Social Innovation<br />720 Bathurst St. Suite 203<br />Toronto, Ontario<br />M5S 2R4<br />Canada</p>\n<p><strong>Berlin office:</strong></p>\n<p>Sourcefabric<br />Prinzessinnenstra&szlig;e 20<br />Aufgang A<br />10969 Berlin<br />Germany</p>\n<p>+49 (0)30 44044999</p>\n<p>If  you need  technical support, please visit our <a href=\"/en/home/support/13/?tpl=15\">Get Help</a> pages. We   also frequent our <a href=\"http://forum.sourcefabric.org\">forums</a> on a very regular  basis; a post there will get a  quick answer!</p>\n<p>Follow us   or contact us on these online social networks also: <a href=\"http://www.facebook.com/pages/Sourcefabric/10150120691955646\" target=\"_blank\">Facebook</a>, <a href=\"http://twitter.com/Sourcefabric\" target=\"_blank\">Twitter</a>, <a href=\"http://friendfeed.com/sourcefabric\" target=\"_blank\">FriendFeed</a>,  <a href=\"http://identi.ca/sourcefabric\" target=\"_blank\">identi.ca</a>, <a href=\"http://www.koornk.com/user/Sourcefabric/\" target=\"_blank\">Koornk</a>,  <a href=\"http://sourcefabric.tumblr.com/\" target=\"_blank\">Tumblr</a>, <a href=\"http://www.youtube.com/user/Sourcefabric\" target=\"_blank\">YouTube</a> and <a href=\"http://vimeo.com/user3337341\" target=\"_blank\">Vimeo</a>.<strong><a href=\"http://forum.sourcefabric.org/blip.tv\" target=\"_blank\"></a> <br /><br /></strong></p>');
