INSERT INTO `plugin_blog_entry` VALUES (18,2,13,3,'2009-03-31 13:44:51','0000-00-00 00:00:00','Welcome to The Custodian sample templates!','<p>Welcome to The Custodian sample templates, a set of Campsite templates and documentation designed to help people just getting started with the Campsite content management system. The Custodian newspaper isn\'t real, of course, but all of the site elements are pretty close to a real production environment.</p>\r\n<p>If you haven\'t seen it already, we strongly recommend you take a look at the documentation for the Classic template set, which is at this address: xxxx.xxxx.xxx.</p>\r\n<p>You can also check out the Campsite manual at this address: <a href=\"http://manuals.campware.org\">http://manuals.campware.org</a>.</p>\r\n<p>We hope you enjoy The Custodian. Feel free to change articles, headlines, anything you see here. To do that, log into the administration interface at http://&lt;your_website_address&gt;/admin.</p>',0,'online','online',1,0,'','2010-09-28 08:02:39');
